import React from "react";

export default function Field (props){
    const component= props.component;
    const label = props.label;



    function textButton ({label}){
        return(
            <div>
                <span></span>
                <p>{label}</p>
            </div>
        )
    }

    function checkComponents(component,label){
        if(component==="text"){
            return textButton(label)
        }
    }


    return(
       checkComponents(component,label)
    )
}
